const e={a1:"The launch screen is a user’s first experience of your application.",a2:"A <strong>placeholder UI</strong> displays core structural elements such as the status and app bars until the app has loaded.",a3:"<strong>Branded launch screens</strong> display your logo or other elements that improve brand recognition.",a4:"Usage",a5:"A placeholder UI is best for apps with very short load times.",a6:"Types of launch screens",a7:"Placeholder UI",a8:"Branded launch",a9:"Because launching your app while displaying a blank canvas increases its perceived loading time, consider using a placeholder UI or a branded launch screen.",a10:"A <strong>placeholder UI</strong> is the most seamless launch transition – appropriate for both app launches and in-app activity transitions.",a11:"<strong>Branded launch screens</strong> provide momentary brand exposure, freeing the UI to focus on content.",a12:"Branded launch screen",a13:"Placeholder UI",a14:"For apps that have very short load times, or don’t have a strong branding need, a placeholder UI presents the fewest possible transitions and greatest perceived responsiveness.",a15:"On launch, core structural elements such as the status bar, app bar, and bottom sheets are displayed without content until the app has loaded.",a16:"Example of placeholder UI",a17:"Branded launch screens are a good way to portray a brand while the app is loading. Take advantage of the loading time to display your logo or other elements that improve brand recognition. Avoid using text on this screen except your logo and, if applicable, a tagline.",a18:"Branded launch",a19:"Launch screens should be used for initial, cold launch from the home screen, and should not be displayed if the application is running, or if the launch comes from another application.",a20:"Examples of branded launch screens",a21:"Material Design launch screen - user's first experience",a22:"Material Design branded launch screen",a23:"Material Design placeholder UI example",a24:"Material Design placeholder UI example",a25:"Branded launch screens in Material Design",a26:"Branded launch screens in Material Design",a27:"Branded launch screens in Material Design",a28:"Branded launch screens in Material Design"};export{e as en};
